USE alienchefs_db;

-- Create a table for recipes
CREATE TABLE recipes (
    id INT AUTO_INCREMENT PRIMARY KEY,
    title VARCHAR(255) NOT NULL,
    ingredients TEXT NOT NULL,
    instructions TEXT NOT NULL,
    owner TEXT NOT NULL,
    image LONGBLOB
);

