-- Create a table for user logins
CREATE TABLE users (
    id INT AUTO_INCREMENT PRIMARY KEY,
    username VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL,
    comments VARCHAR(255),
    permission VARCHAR(255) NOT NULL
);
